"""
Given a binary string, binary, that contains only zero and one characters,
return the total number of substrings within binary the only contain one characters.

Ex: Given the following string binary…

binary = "1011", return 4 ("1", "1", "1", and "11").
Ex: Given the following string binary…

binary = "000", return 0.
"""


class Solution:
    def numSub(self, s: str) -> int:
        return int(sum(len(a) * (len(a) + 1) / 2 for a in s.split("0")) % (10**9 + 7))


# Test Cases
if __name__ == "__main__":
    solution = Solution()
    print(solution.numSub("1011"))
    print(solution.numSub("000"))
    print(
        solution.numSub(
            ""
        )
    )
